import React, { useState } from 'react';
import { Routes, Route, Link, useNavigate } from 'react-router-dom';
import Menu from './Menu';
import Restaurants from './Restaurants';
import Track from './Track';
import Contact from './Contact';
import './styles.css';
import './Trash.css';
import MyOrders from './MyOrders';

function DashBoard() {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const userEmail = localStorage.getItem('email');
  const userName = userEmail ? userEmail.split('@')[0] : "Guest";
  const user = {
    name: userName,
    profileImage: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRhP1LzsEOSiEWX4xedVLb8maKpMnHCUpdtNQ&s" // Replace with actual URL if available
  };

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  const navigate = useNavigate();
  const handleLogout = (event) => {
    event.preventDefault();
    localStorage.removeItem('token');
    localStorage.removeItem('userEmail');
    setIsDropdownOpen(false);
    navigate('/');
  };

  return (
    <div className="App">
      <header>
        <div className="navbar">
          <h1 className="logo">JourneyIndia</h1>
          <nav>
            <ul>
              <li><Link to="/dashboard">Home</Link></li>
              {/* <li><Link to="/dashboard/menu">Menu</Link></li> */}
              <li><Link to="/dashboard/restaurants">Explore</Link></li>
              {/* <li><Link to="/dashboard/track">Track Order</Link></li> */}
              <li><Link to="/dashboard/contact">Contact</Link></li>
            </ul>
          </nav>
          <div className="profile" onClick={toggleDropdown}>
            <img src={user.profileImage} alt="Profile" className="profile-image" />
            {isDropdownOpen && (
              <div className="dropdown-menu">
                <p>{user.name}</p>
                <Link to="/dashboard/my-orders">My Bookings</Link>
                <button onClick={handleLogout}>Logout</button>
              </div>
            )}
          </div>
        </div>
      </header>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="menu" element={<Menu />} />
        <Route path="restaurants" element={<Restaurants />} />
        <Route path="track" element={<Track />} />
        <Route path="contact" element={<Contact />} />
        <Route path="my-orders" element={<MyOrders />} /> {/* Add this route */}
      </Routes>

      <footer>
        <p>&copy; 2024 JourneyIndia. All rights reserved.</p>
      </footer>
    </div>
  );
}

function Home() {
  return (
    <section id="hero">
      <div className="hero-content">
        <h2>Wherever you go, go with all your heart</h2>
        <p>Order food from top restaurants and get it delivered directly to your train seat.</p>
        {/* <Link to="/dashboard/menu">
          <button className="cta-button">Book Now</button>
        </Link> */}
      </div>
    </section>
  );
}

export default DashBoard;
